import './App.css';
import Layout from './components/Layout';
import Home from './containers/Home';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Layout>
          <Routes>
            <Route exact path='/' element={<Home/>}></Route>
          </Routes>
        </Layout>
      </BrowserRouter>

    </div>
  );
}

export default App;
